import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Home from './pages/Home';
import KioskSelfCheckout from './components/KioskSelfCheckout';
import DaisoKiosk from './pages/DaisoKiosk';

function App() {
  return (
    <BrowserRouter>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/kiosk" element={<KioskSelfCheckout />} />
          <Route path="/daiso" element={<DaisoKiosk />} />
        </Routes>
      </Layout>
    </BrowserRouter>
  );
}

export default App;
